## This mod requires [CraftTweaker](https://modrinth.com/mod/crafttweaker) to run

<p>ContentTweaker is an addon for <a href="https://modrinth.com/mod/crafttweaker" rel="nofollow">CraftTweaker</a>. Crafttweaker lets you adjust recipes, remove them entirely, or add new recipes. One of the features that it lacks is the ability to create new items&nbsp;and blocks, ContentTweaker plans on allowing users to add more to their game, not only recipes but actual items and blocks.</p>

<p>Currently, with ContentTweaker, you can add the following:</p>
<p>&nbsp;&bull; New Items</p>
<p>&nbsp;&bull; New Blocks</p>
<p>&nbsp;&bull; New Creative Tabs</p>

<p>Due to the limitations enforced by Minetweaker, Scripts containing methods from this mod, should be treated differently from normal Minetweaker scripts, the most noticeable differences are:</p>
<p>&bull; Scripts go in the "scripts" folder same as CraftTweaker, however they need to start with '#loader contenttweaker`' as the first line</p>

<p><strong>You can find more information here:</strong><br>You can find documentation for the mod on the official Minetweaker wiki here: <a href="https://docs.blamejared.com/" rel="nofollow">ContentTweaker Wiki</a></p>
<h2><em><strong>How It Works:</strong><br></em></h2>
<p>Using a Zenscript Syntax you can create new items and blocks to the game rather simply.<br>These blocks are treated the same way as any other standard block, and thus requires a model(Supports .obj)/texture JSON and a texture.&nbsp;<br><br>You'll find appropriate directories in the ACRONYM/ContentTweaker sub-folder in your config directory. More information on how to create your blocks and how to handle resources will be available on our GitHub wiki and hopefully soon on the official MineTweaker&nbsp;web page!</p>

<p>Here's one of the very basic test examples we currently feature on our GitHub&nbsp;wiki:</p>
<pre>import mods.contenttweaker.VanillaFactory;
import mods.contenttweaker.Block;

var zsBlock = VanillaFactory.createBlock("zs_block", &lt;blockmaterial:iron&gt;);
zsBlock.fullBlock = true;
zsBlock.lightOpacity = 255;
zsBlock.translucent = true;
zsBlock.lightValue = 1.0;
zsBlock.blockHardness = 5.0;
zsBlock.blockResistance = 5.0;
zsBlock.toolClass = "pickaxe";
zsBlock.toolLevel = 2;
zsBlock.blockSoundType = &lt;soundtype:metal&gt;;
zsBlock.register();</pre>
